import React from 'react'

const BookCard = (props) => {
    return (
        <div>
            <img src={props.image} alt=" "/>
            <h2>{props.title}</h2>
            <h2>{props.autor}</h2>
            <p>{props.download}</p>
        </div>
    )
}

export default BookCard
